@test integrate(F^(c+d*x)*(a+b*F^(c+d*x))^n, x) == :(b^-1*d^-1*(1+n)^-1*(a+b*F^(c+d*x))^(1+n)*log(F)^-1)
@test integrate((a+b*exp(x)^n)^p*exp(x)^n, x) == :(b^-1*n^-1*(1+p)^-1*(a+b*exp(x)^n)^(1+p))
@test integrate((a+b*exp(x)^n)^p*exp(n*x), x) == :(b^-1*n^-1*(1+p)^-1*(a+b*exp(x)^n)^(1+p)*exp(x)^(-1n)*exp(n*x))
